_ttrack() {
    local i cur prev opts cmd
    COMPREPLY=()
    cur="${COMP_WORDS[COMP_CWORD]}"
    prev="${COMP_WORDS[COMP_CWORD-1]}"
    cmd=""
    opts=""

    for i in ${COMP_WORDS[@]}
    do
        case "${cmd},${i}" in
            ",$1")
                cmd="ttrack"
                ;;
            ttrack,help)
                cmd="ttrack__help"
                ;;
            ttrack,pause)
                cmd="ttrack__pause"
                ;;
            ttrack,r)
                cmd="ttrack__report"
                ;;
            ttrack,report)
                cmd="ttrack__report"
                ;;
            ttrack,resume)
                cmd="ttrack__resume"
                ;;
            ttrack,s)
                cmd="ttrack__start"
                ;;
            ttrack,start)
                cmd="ttrack__start"
                ;;
            ttrack,stop)
                cmd="ttrack__stop"
                ;;
            ttrack,t)
                cmd="ttrack__track"
                ;;
            ttrack,track)
                cmd="ttrack__track"
                ;;
            ttrack__help,help)
                cmd="ttrack__help__help"
                ;;
            ttrack__help,pause)
                cmd="ttrack__help__pause"
                ;;
            ttrack__help,report)
                cmd="ttrack__help__report"
                ;;
            ttrack__help,resume)
                cmd="ttrack__help__resume"
                ;;
            ttrack__help,start)
                cmd="ttrack__help__start"
                ;;
            ttrack__help,stop)
                cmd="ttrack__help__stop"
                ;;
            ttrack__help,track)
                cmd="ttrack__help__track"
                ;;
            *)
                ;;
        esac
    done

    case "${cmd}" in
        ttrack)
            opts="-f -h -V --file --help --version track t report r start s pause resume stop help"
            if [[ ${cur} == -* || ${COMP_CWORD} -eq 1 ]] ; then
                COMPREPLY=( $(compgen -W "${opts}" -- "${cur}") )
                return 0
            fi
            case "${prev}" in
                --file)
                    COMPREPLY=($(compgen -f "${cur}"))
                    return 0
                    ;;
                -f)
                    COMPREPLY=($(compgen -f "${cur}"))
                    return 0
                    ;;
                *)
                    COMPREPLY=()
                    ;;
            esac
            COMPREPLY=( $(compgen -W "${opts}" -- "${cur}") )
            return 0
            ;;
        ttrack__help)
            opts="track report start pause resume stop help"
            if [[ ${cur} == -* || ${COMP_CWORD} -eq 2 ]] ; then
                COMPREPLY=( $(compgen -W "${opts}" -- "${cur}") )
                return 0
            fi
            case "${prev}" in
                *)
                    COMPREPLY=()
                    ;;
            esac
            COMPREPLY=( $(compgen -W "${opts}" -- "${cur}") )
            return 0
            ;;
        ttrack__help__help)
